import React from "react";
import Skill from "./Skill.js";
export default class extends React.Component{
    state={
        titles:{
            webDev:{
                title:"Web Development",
                skills:["React","SCSS"],
            },
            personal:{
                title:"Personal",
                skills:"Loving Jaymee",
            }
        }
    }
    render(){
        return(
            this.state.titles.map(x=>(
                <Skill title={x.title}/>
            ))
            // <Skill/>
        );
    }
}
